import React,{Component} from 'react';

import Task from './Task'

class Tasks extends Component {


    render () {
        return (
         <div> {this.props.tasks.map(task=> 
         <Task task={ task} />
          
         ) 
        } </div>)
    }
}


export default Tasks;
